# Ganti dengan API key Google Maps Anda jika ingin reverse geocode
google_api_key <- "YOUR_GOOGLE_API_KEY"

get_address_from_coords <- function(lat, lng, api_key = NULL) {
  if (!is.null(api_key) && nzchar(api_key) && api_key != "YOUR_GOOGLE_API_KEY") {
    url <- paste0(
      "https://maps.googleapis.com/maps/api/geocode/json?latlng=",
      lat, ",", lng, "&key=", api_key
    )
    res <- tryCatch({
      jsonlite::fromJSON(httr::content(httr::GET(url), as="text", encoding="UTF-8"))
    }, error=function(e) NULL)
    if (!is.null(res) && length(res$results) > 0) {
      return(res$results[[1]]$formatted_address)
    }
  }
  return(NULL)
}

dummy_data <- data.frame(
