server <- function(input, output, session) {
  current_page <- reactiveVal("slide1")
  current_user <- reactiveVal(NULL)
  pengaduan_data <- reactiveVal(dummy_data)
  report_lat <- reactiveVal(NULL)
  report_lng <- reactiveVal(NULL)
  
  alamat_choices <- reactive({
    unique(c(
      pengaduan_data()$Lokasi,
      alamat_default
    ))
  })
  
  output$main_ui <- renderUI({
    switch(current_page(),
           "slide1" = fluidPage(
             tags$div(class = "center-logo",
                      tags$img(src = "data:image/jpeg;base64,", class = "app-logo")
             ),
             tags$div(style = "text-align:center;",
                      tags$div(class = "main-title", "BenerIn"),
                      tags$div(class = "subtitle", "Aplikasi Pengaduan Infrastruktur"),
                      actionButton("start_btn", "Let's get started", class = "btn-benerin")
             )
           ),
           "slide2" = fluidPage(
             tags$div(class = "center-logo",
                      tags$img(src = "data:image/jpeg;base64,", class = "app-logo")
             ),
             tags$div(style = "text-align:center;",
                      tags$div(class = "form-box",
                               tags$div(class = "form-title", "Sign-In"),
                               tags$label("NIK/No. KTP*", style = "font-size:20px; font-weight:bold; float:left;"),
                               tags$br(),
                               textInput("nik_input", NULL, placeholder = "*numbers only", width = "340px"),
                               actionButton("sign_in_btn", "Sign-In", class = "btn-benerin")
                      )
             )
           ),
           "slide3" = fluidPage(
             tags$div(class = "center-logo",
                      tags$img(src = "data:image/jpeg;base64,", class = "app-logo")
             ),
             tags$div(class="feature-row",
                      tags$div(class="feature-box",
                               tags$div(class="feature-title", "Heat Map"),
                               actionButton("access_heatmap", "Access", class="access-btn")
                      ),
                      tags$div(class="feature-box",
                               tags$div(class="feature-title", "Report"),
                               actionButton("access_report", "Access", class="access-btn")
                      ),
                      tags$div(class="feature-box",
                               tags$div(class="feature-title", "Status"),
                               actionButton("access_status", "Access", class="access-btn")
                      )
             )
           ),
           "heatmap" = fluidPage(
             tags$div(class = "center-logo",
                      tags$img(src = "data:image/jpeg;base64,", class = "app-logo")
             ),
             actionButton("back_to_slide3_from_heatmap", "Back", class = "back-btn"),
             tags$div(class="table-title", "Heat Map"),
             leafletOutput("heatmap_map", height = "400px")
           ),
           "report" = fluidPage(
             tags$div(class = "center-logo",
                      tags$img(src = "data:image/jpeg;base64,", class = "app-logo")
             ),
             actionButton("back_to_slide3_from_report", "Back", class = "back-btn"),
             tags$div(class = "form-box",
                      tags$div(class = "form-title", "Form Pengaduan"),
                      textInput("report_lokasi", "Lokasi", placeholder = "Tulis alamat/lokasi"),
                      leafletOutput("report_map", height = "180px"),
                      dateInput("report_tanggal", "Tanggal", Sys.Date()),
                      selectInput("report_jenis", "Jenis Infrastruktur", c("Jalan", "Jembatan", "Penerangan")),
                      textAreaInput("report_deskripsi", "Deskripsi", placeholder = "Tulis deskripsi kerusakan"),
                      fileInput("report_foto", "Upload Foto", buttonLabel = "Browse Photo"),
                      uiOutput("selected_foto"),
                      actionButton("send_report", "Send", class = "send-btn")
             )
           ),
           "status" = fluidPage(
             tags$div(class = "center-logo",
                      tags$img(src = "data:image/jpeg;base64,", class = "app-logo")
             ),
             actionButton("back_to_slide3_from_status", "Back", class = "back-btn"),
             tags$div(class="table-title", "Histori Pengaduan"),
             tags$div(class="table-box",
                      tags$div(style="display:flex; align-items:center; gap:16px;",
                               tags$label("show"),
                               selectInput("show_entries", NULL, choices = c(10,25,50), selected = 10, width="80px"),
                               tags$label("entries"),
                               tags$div(style="flex:1;"),
                               tags$label("search:"),
                               textInput("search_pengaduan", NULL, placeholder = "Type here....", width = "180px")
                      ),
                      DTOutput("pengaduan_table"),
                      actionButton("tambah_pengaduan", "Tambah Pengaduan", class = "tambah-btn")
             )
           )
    )
  })
  
  # Navigasi antar halaman
  observeEvent(input$start_btn, { current_page("slide2") })
  observeEvent(input$sign_in_btn, {
    nik <- input$nik_input
    if (grepl("^[0-9]{16}$", nik)) {
      current_user(nik)
      current_page("slide3")
    } else {
      showModal(modalDialog(
        title = "Login Gagal",
        "Harap masukkan NIK yang valid.",
        easyClose = TRUE
      ))
    }
  })
  observeEvent(input$access_heatmap, { current_page("heatmap") })
  observeEvent(input$access_report, { current_page("report") })
  observeEvent(input$access_status, { current_page("status") })
  observeEvent(input$back_to_slide3_from_heatmap, { current_page("slide3") })
  observeEvent(input$back_to_slide3_from_report, { current_page("slide3") })
  observeEvent(input$back_to_slide3_from_status, { current_page("slide3") })
  observeEvent(input$tambah_pengaduan, { current_page("report") })
  
  # Autocomplete alamat (jika ingin, bisa pakai selectizeInput)
  observe({
    updateTextInput(session, "report_lokasi", value = "")
  })
  
  # Map pada form pengaduan
  output$report_map <- renderLeaflet({
    leaflet() %>%
      addTiles() %>%
      setView(lng = 106.8, lat = -6.2, zoom = 12)
  })
  
  observe({
    leafletProxy("report_map") %>% clearMarkers()
    if (!is.null(report_lat()) && !is.null(report_lng())) {
      leafletProxy("report_map") %>% addMarkers(lng = report_lng(), lat = report_lat())
    }
  })
  
  # Klik map, kolom alamat otomatis terisi nama jalan dan koordinat
  observeEvent(input$report_map_click, {
    click <- input$report_map_click
    if (!is.null(click)) {
      report_lat(click$lat)
      report_lng(click$lng)
      alamat <- get_address_from_coords(click$lat, click$lng, google_api_key)
      if (!is.null(alamat)) {
        alamat_full <- paste0(alamat, " (", sprintf("%.6f, %.6f", click$lat, click$lng), ")")
      } else {
        alamat_full <- paste0("Koordinat: ", sprintf("%.6f, %.6f", click$lat, click$lng))
      }
      updateTextInput(session, "report_lokasi", value = alamat_full)
    }
  })
  
  # Tampilkan nama file foto
  output$selected_foto <- renderUI({
    if (!is.null(input$report_foto)) {
      tags$span(input$report_foto$name)
    }
  })
  
  # Kirim pengaduan dan simpan data
  observeEvent(input$send_report, {
    req(current_user())
    if (is.null(input$report_lokasi) || input$report_lokasi == "" ||
        is.null(input$report_tanggal) ||
        is.null(input$report_jenis) || input$report_jenis == "" ||
        is.null(input$report_deskripsi) || input$report_deskripsi == "" ||
        is.null(report_lat()) || is.null(report_lng())) {
      showModal(modalDialog(
        title = "Gagal",
        "Mohon lengkapi semua data pengaduan dan pilih lokasi di map.",
        easyClose = TRUE
      ))
      return()
    }
    new_entry <- data.frame(
      NIK = current_user(),
      Tanggal = input$report_tanggal,
      Lokasi = input$report_lokasi,
      Jenis = input$report_jenis,
      Deskripsi = input$report_deskripsi,
      Foto = ifelse(is.null(input$report_foto), "", input$report_foto$name),
      Status = "Terkirim",
      lat = report_lat(),
      lng = report_lng(),
      stringsAsFactors = FALSE
    )
    pengaduan_data(rbind(pengaduan_data(), new_entry))
    showModal(modalDialog(
      title = "Sukses",
      "Pengaduan berhasil dikirim!",
      easyClose = TRUE
    ))
    current_page("status")
  })
  
  # Heatmap
  output$heatmap_map <- renderLeaflet({
    data <- pengaduan_data()
    leaflet(data) %>%
      addTiles() %>%
      addCircleMarkers(
        lng = ~lng, lat = ~lat,
        color = "#94c7fe", radius = 12, fillOpacity = 0.7,
        label = ~Lokasi,
        popup = ~paste0(
          "<b>", Lokasi, "</b><br>",
          "Koordinat: ", sprintf("%.6f, %.6f", lat, lng), "<br>",
          "Jenis: ", Jenis, "<br>",
          "Deskripsi: ", Deskripsi, "<br>",
          "Status: ", Status
        )
      ) %>%
      setView(lng = 106.8, lat = -6.2, zoom = 12)
  })
  
  # Tabel Histori Pengaduan dengan filter dan pagination
  output$pengaduan_table <- renderDT({
    data <- pengaduan_data()
    data <- data[data$NIK == current_user(), ]
    if (!is.null(input$search_pengaduan) && nzchar(input$search_pengaduan)) {
      keyword <- tolower(input$search_pengaduan)
      data <- data[apply(data, 1, function(row) any(grepl(keyword, tolower(row), fixed=TRUE))), ]
    }
    n <- as.numeric(input$show_entries)
    datatable(
      head(data, n),
      options = list(dom = "tip", pageLength = n),
      rownames = FALSE,
      colnames = c("NIK","Tanggal","Lokasi","Jenis","Deskripsi","Foto","Status","lat","lng")
    )
  })
}

shinyApp(ui, server)
